import { Checkbox, Input } from "antd";
import {useForm} from 'react-hook-form';
import { Link } from "react-router-dom";
import "./pages.scss";

function NewAccountPage() {

  const {register,
          formState: {
            errors,
          },
        handleSubmit,
      } = useForm();

  const onSubmitForm = (data) =>{
    console.log(JSON.stringify(data));
  }

  return (
    <form onSubmit={handleSubmit(onSubmitForm)} className="sing-page">
      <p className="sing-page__header">Create new account</p>

      <label className="sing-page__name-input">
        Username
          <input {...register('Username')} className="sing-page__input" placeholder="Username" />
      </label>

      <label className="sing-page__name-input">
        Email address
          <input {...register('Email address')} className="sing-page__input" placeholder="Email address" />
      </label>

      <label className="sing-page__name-input">
        Password
          <input {...register('Password')} className="sing-page__input" placeholder="Password" />
      </label>

      <label className="sing-page__name-input">
        Repeat Password
        <input {...register('Repeat Password')} className="sing-page__input" placeholder="Password" />
      </label>

      <Checkbox className="checkbox-sing-up">
        I agree to the processing of my personal information
      </Checkbox>

      <Input type="submit" className="sing-page__button" value={'Create'}></Input>
      <p className="sing-page__question">
        Already have an account?{" "}
        <Link className="sing-link" to={"/sing_in"}>
          Sign In
        </Link>
        .
      </p>
    </form>
  );
}

export default NewAccountPage;
